/*
想要搞清楚这个问题，首先我们需要翻阅一下String的源码，
看下其中是否有关于长度的限制或者定义：

String 有很多重载的构造函数，其中有一些是支持用户传入 length 来执行长度的
-------
String(byte bytes[], int offset, int length, String charsetName)
String(byte bytes[], int offset, int length, Charset charset)
String(byte bytes[], int offset, int length)
-------------
可以看到，这里的长度参数是通过 int 类型定义的，即，String 定义的时候，
最大支持的长度就是 int 的最大范围值（2^31 - 1）。
*/


/*
那么，我们是不是就可以认为String能支持的最大长度就是这个值了呢？

其实并不是，这个值只是在运行期，我们构造String的时候可以支持的一个最大长度，
而实际上，在编译期，定义字符串的时候也是有长度限制的。

如下代码：
 */
class StringMax {
    public static void main(String[] args) {
        // 100万个数字
//        String s = "";
    }
}
/*
编译报错：Error:(26, 20) java: 常量字符串过长

那么，明明 String 的构造函数指定的长度是可以支持 2147483647(2^31 - 1)(21亿) 的，
为什么像以上形式定义的时候无法编译呢？

其实，形如 String s = "xxx"; 定义 String 的时候，xxx 被我们称之为字面量，
这种字面量在编译之后会以常量的形式进入到 Class 常量池。

因为要进入常量池，就要遵守常量池的有关规定：
 */

/*
【常量池限制】
javac是将Java文件编译成class文件的一个命令，那么在Class文件生成过程中，就需要遵守一定的格式。
（JVM关于常量池的内容暂时省略）
也就是说，Class文件中常量池的格式规定了，其字符串常量的长度不能超过65535。

那么，尝试使用 65535 的字符串
 */
class String_65535 {
    public static void main(String[] args) {
        // s_65535.length = 65535;
//        String s_65535 = "";
    }
}
/*
使用javac编译，同样会得到"错误: 常量字符串过长"，那么原因是什么呢？

这是因为在编译代码中，当参数类型为 String，并且长度大于等于 65535 的时候，就会导致编译失败。
 */


/**
 * 下面使用 65534 长度的字符串试试：
 */
class String_65534 {
    public static void main(String[] args) {
        String s_65534 = "";
    }
}
/*
可以正常编译。
 */




/*
【运行期限制】
上面提到的这种 String 长度的限制是_编译期的限制_，
也就是使用 String s= “”; 这种字面值方式定义的时候才会有的限制。

那么。String 在运行期有没有限制呢？
答案是有的，就是我们前文提到的那个 Integer.MAX_VALUE ，这个值约等于4G。
在运行期，如果String的长度超过这个范围，就可能会抛出异常。(在jdk 1.9之前）
---------
2^31-1 =2147483647 个 16-bit Unicodecharacter

2147483647 * 16 = 34359738352 位
34359738352 / 8 = 4294967294 (Byte)
4294967294 / 1024 = 4194303.998046875 (KB)
4194303.998046875 / 1024 = 4095.9999980926513671875 (MB)
4095.9999980926513671875 / 1024 = 3.99999999813735485076904296875 (GB)
-------------

很多人会有疑惑，编译的时候最大长度都要求小于65535了，
运行期怎么会出现大于65535的情况呢。
这其实很常见，如以下代码：
 */
class StringLengthTestDemo {
    public static void main(String[] args) {
        String s = "";
        /* 将 s 拼接 10_000 次 */
        for (int i = 0; i < 50_000; i++) {
            s += "12345678901234567890";
        }
        // s.length() = 1000000（100万）
        System.out.format("%d%n%s", s.length(), s);
    }
}


/*
【总结】
字符串有长度限制。
_在编译期_要求字符串常量池中的常量不能超过 65535，
并且在 javac 执行过程中控制了最大值为 65534。

_在运行期_，长度不能超过 Int 的范围（约 21 亿），否则会抛异常。
 */
